import 'package:json_annotation/json_annotation.dart';part 'deductions_dto.g.dart';@JsonSerializable(ignoreUnannotated: false)class Deduction {  @JsonKey(name: 'name')  final String? name;  @JsonKey(name: 'value')  final String? value;  @JsonKey(name: 'icon')  final String? icon;  Deduction({this.name, this.value, this.icon});  factory Deduction.fromJson(Map<String, dynamic> json) => _$DeductionFromJson(json);  Map<String, dynamic> toJson() => _$DeductionToJson(this);}